import React, { useEffect, useState } from 'react';
import { Parallax } from 'react-parallax';
import Footer from '../../Components/Footer';
import NavBar from '../../Components/NavBar';
import queueImage from '../../assets/queue.jpg';
import style from './style.module.css';
import classNames from 'classnames';
import api from '../../service/api';
import loading from '../../assets/loading.svg';
import ProcessingSong from '../../Components/ProcessingSong';

const Queue = () => {
  const [songs, setSongs] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const fetchSongs = async () => {
      if (localStorage.getItem('token')) {
        await getUserID();
      } else {
        await getInQueueSongsByIp();
      }
    };
    fetchSongs();
  }, []);

  const getInQueueSongsByIp = async () => {
    try {
      const response = await api.get('/song/songbyip');
      setSongs(response.data);
    } catch (error) {
      handleError(error);
    } finally {
      setIsLoading(false);
    }
  };

  const getUserID = async () => {
    const token = localStorage.getItem('token');
    try {
      const userResponse = await api.get('/user', {
        headers: { Authorization: `Bearer ${token}` }
      });
      const songsResponse = await api.get(`/song/getqueuesongs/${userResponse.data.email}`);
      setSongs(songsResponse.data);
    } catch (error) {
      handleError(error);
    } finally {
      setIsLoading(false);
    }
  };

  const handleError = (error) => {
    if (error.response) {
      console.log('Response error data:', error.response.data);
    } else if (error.request) {
      console.log('Request error:', error.request);
    } else {
      console.log('Error:', error.message);
    }
  };

  if (isLoading) {
    return (
      <div>
        <NavBar scrolled={true} />
        <div className={style.Loading}>
          <img src={loading} alt="Loading" />
        </div>
      </div>
    );
  }

  return (
    <>
      {/*Loading Bar*/}
      <div className="super_container">
        <NavBar active={2}></NavBar>

        <Parallax className="parallax_background parallax-window" bgImage={queueImage} speed={0.8}>
          <div className={style.home}>
            <div
              className={classNames(
                style.home_container,
                'd-flex flex-column align-items-center justify-content-center'
              )}
            >
              <div className={style.home_content}>
                <div className={style.home_title}>
                  <h1>Processing Queue</h1>
                </div>
              </div>
            </div>
          </div>
        </Parallax>

        <div className={style.blog}>
          <div className="container">
            <div className="row">
              <div className={style.blog_posts}>
                {/* Loading the songs that are in the queue */}
                {songs.map((song) => {
                  return <ProcessingSong key={song.id} song={song} />;
                })}
              </div>
            </div>
          </div>
        </div>
      </div>

      <Footer></Footer>
    </>
  );
};

export default Queue;
